function App() {
  return (
    <div className="App">
      <Background />
      <Header />
      <Form />
    </div>
  );
}

export default App;

const Background = () => {
  return <div className="background"></div>;
};

const Header = () => {
  return (
    <header className="header">
      <div className="container">
        <div className="logo">
          <a href="/">
            <img className="pfpf" src="/Logo/logo3.png" alt="" />
          </a>
          <a href="/" className="logo-modern-tech">
            <span className="co">Co</span>
            <span className="vertex">VERTEX</span>
          </a>
        </div>
        {/* Navigation Links */}
        <nav className="nav">
          <ul>
            <li>
              <a href="/">Home</a>
            </li>
            <li>
              <a href="/services">Services</a>
            </li>
            <li>
              <a href="/about">About Us</a>
            </li>
            <li>
              <a href="/contact">Contact</a>
            </li>
          </ul>
        </nav>
        {/* Call to Action Button */}
        <div className="cta">
          <a href="/get-started">Get Started</a>
        </div>
      </div>
    </header>
  );
};

const Form = () => {
  return <div></div>;
};
